import React from 'react';
import Container from './styles';

export default function Navbar_Component(props){

  return(
    <Container>
      <nav>
          <ul>
            <li>
              <a href="#" >Início</a>
              <a href="#" >Dados</a>
              <a href="#" >Metodologia</a>
              <a href="#" >Contato</a>
            </li>
          </ul>
        </nav>
    </Container>
  )
}
